	/**
	 * @description 初始化数据,结合initReady使用
	 */
	function initData() {
		//增加区域滚动，解决【iphone4s】研习圈-个人主页-圈主管理：划至最底部的提交按钮处，再点击页面右上角“+”号按钮，更多选项图标文字都被遮挡了，无法正常显示，。
		mui(".mui-scroll-wrapper").scroll({
			indicators: false, //不显示滚动条
			deceleration: 0.0006 //flick 减速系数，系数越大，滚动速度越慢，滚动距离越小，默认值0.0006
		});
		circleId = WindowUtil.getExtraDataByKey("circleId");
		secretKey = StorageUtil.getStorageItem("secretKey");
		var userSession = StorageUtil.getStorageItem("UserSession");
		//console.log("用户信息：" + JSON.stringify(userSession));
		if(userSession.userId) {
			userId = userSession.userId;
		}
		//console.log(circleId);
		ToggleMenuUtil.initToggleMenu('menu-btn');
		circleSet();
		//initComponents();
	}

